import { Table } from "antd";

function ThreatsTable() {
  return (
    <div>
      <h3 style={{ color: "white" }}>Detected Cyber Security Threats</h3>
      <Table dataSource={dataSource} columns={columns} size="small" />
    </div>
  );
}

const dataSource = [
  {
    key: "1",
    name: "Mike",
    age: 32,
    address: "10 Downing Street",
  },
  {
    key: "2",
    name: "John",
    age: 42,
    address: "10 Downing Street",
  },
];

const columns = [
  {
    title: "Name",
    dataIndex: "name",
    key: "name",
  },
  {
    title: "Age",
    dataIndex: "age",
    key: "age",
  },
  {
    title: "Address",
    dataIndex: "address",
    key: "address",
  },
];

export default ThreatsTable;
